#include<bits/stdc++.h>
#define int long long int
#define endl "\n"
using namespace std;

int solve(string haystack, string needle) {
    if(needle=="") return 0;
    int index = 0;
    int i = 0;
    for(auto x: haystack) {
        if(x==needle[0]) {
            i=0;
            for(auto y: needle) {
                if(y!=haystack[index+i]) {
                    break;
                }
                i++;
            }
            if(i==needle.size()) break;
        }
        index++;
    }
    if(index==haystack.size()) return -1;
    return index;
}

int32_t main() {
    ios_base::sync_with_stdio(0);cin.tie(0);cout.tie(0);cerr.tie(0);
    clock_t initialTime = clock();
    #ifndef ONLINE_JUDGE
        freopen("input.txt", "r", stdin);
        freopen("output.txt", "w", stdout);
        freopen("error.txt", "w", stderr);
    #endif
    cout<<solve("","");
    cerr<<((double)clock()-initialTime)/CLOCKS_PER_SEC;
    return 0;
}